import Link from "next/link";

const NavBar = () => {
	return (
		<>
			<nav>
				<ul>
					<li>
						<Link href="/">Home</Link>
					</li>
					<li>
						<Link href="/about">About us</Link>
					</li>
					<li>
						<Link href="/sign-up">SignUp</Link>
					</li>
				</ul>
			</nav>
		</>
	);
};

export default NavBar;
